	  ,case when nvl(als_lst_id_nbank_inteday,0) >= nvl(als_lst_cell_nbank_inteday,0) then nvl(als_lst_id_nbank_inteday,0) else nvl(als_lst_cell_nbank_inteday,0) end as als_lst_nbank_inteday
